import React, { useReducer } from 'react';
import logo from './logo.svg';
import './App.css';
import PageLayout from './PageLayout.js'
import Home from './Home.js';

export default function App() {
  const [windows, dispatch] = useReducer(windowsReducer, ['home', '', '', 'home']);
  return (
    <PageLayout>
      {windows[0] !== '' && <div style={{
        gridRowStart: 'a0',
        gridRowEnd: (windows[2] === '' ? 'a2' : 'a0'),
        gridColumnStart: 'a0',
        gridColumnEnd: (windows[1] === '' ? 'a1' : 'a0')
      }}>
        {windows[0] === 'home' && <Home></Home>}
      </div>}

      {windows[1] !== '' && <div style={{
        gridRowStart: 'a1',
        gridRowEnd: (' / ' + windows[3] === '' ? 'a3' : 'a1'),
        gridColumnStart: (windows[0] === '' ? 'a0' : 'a1'),
        gridColumnEnd: 'a1'
      }}>
        {windows[1] === 'home' && <Home></Home>}
      </div>}

      {windows[2] !== '' && <div style={{
        gridRowStart: (windows[0] === '' ? 'a0' : 'a2'),
        gridRowEnd: 'a2',
        gridColumnStart: 'a2',
        gridColumnEnd: (windows[3] === '' ? 'a3' : 'a2')
      }}>
        {windows[2] === 'home' && <Home></Home>}
      </div>}

      {windows[3] !== '' && <div style={{
        gridRowStart: (windows[1] === '' ? 'a1' : 'a3'),
        gridRowEnd: 'a3',
        gridColumnStart: (windows[2] === '' ? 'a2' : 'a3'),
        gridColumnEnd: 'a3'
      }}>
        {windows[3] === 'home' && <Home></Home>}
      </div>}
    </PageLayout>
  );
}

function windowsReducer(windows, action) {
  switch (action.type) {
    case 'add': {
      return windows.with(action.position, action.newScreen);
    }
    case 'remove': {
      return windows.with(action.position, '');
    }
    default: {
      throw Error('Unknown action in windowsReducer: ' + action.type);
    }
  }
}
